import React from 'react'

const Ejemplo = () => {

    const titulo = "Hola mundo";
    const subtitulo = "Todo bien? Todo correcto? y yo que me alegro";

  return (
    <div>
      <h1>{titulo}</h1>
      <h2>{subtitulo}</h2>
    </div>
  )
}

export default Ejemplo
